import React, {useState, useEffect} from 'react';
import {Link} from "react-router-dom";


import "./side-nav.styles.scss";

function SideNav () {

    const [isCliked, setIsclicked] = useState( !false);

    
    
    const handleClick = () => {
        
        setIsclicked(! isCliked);
        
       const sideNav = document.querySelector('.side-nav');

       isCliked ? sideNav.style.width = '350px' :  sideNav.style.width = '0px'
      
    }

   
 

    return (
        <div className="side-menu">

        
           
            <div className='side-nav'>
            <a className="close-btn" onClick={handleClick}>&times;</a>
                <a href='#'>Шкатулки</a>
               
                <a href="#">Салфетницы</a>
                <a href="#">Корзинки</a>
            </div> 
            <div className='side-menu-button' onClick={handleClick}>
            <span className='side-menu-icon'>&#9776;</span> Категории
            </div> 
   

       
       
          
        </div>
    )
}


export default SideNav;
